import React from 'react';
import Navbar from './ClassComponents/Navbar';  // Assuming Navbar component
import Footer from './ClassComponents/Footer';  // Newly created Footer component
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      {/* Other content for the homepage can go here */}
         <p>Everyone is aging! We are living longer than ever before for the first time in the history of the world!

The population shift will change our society and WSU researches are actively working to answer the many specific questions about how we will adapt, such as:


• How can we support people to age with dignity?

• How can older adults stay engaged and connected?

• How will family relationships between older and younger generations be affected by increased longevity?

•How will we design and deliver services that best support older adults and their families?

•How will our communities adapt to an aging population?


    WSU researchers may need your opinion and perspective in addressing these research questions. Your participation in research can help others and contributes to advancing knowledge about aging. If you’d like to explore some of the current research labs focused on aging research, check here.</p>
      <Footer />
    </div>
  );
}

export default App;
